import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'TrafficFlowAi';
}
<nav id="nav">
  <div class="container flex">
    <img src="chatgpt.png" />
    <div class="links">
      <a>API</a>
      <a>Research</a>
      <a>Blog</a>
      <a>About</a>
    </div>
  </div>
</nav>

<router-outlet></router-outlet>
